const RandomWord = () => {
    const randomIndex = Math.floor(Math.random() * words.length)
    return words[randomIndex]
}

const word = RandomWord()


const Table = () => {
    const elem = []
    const t = document.getElementById('t')
    for (let y = 0; y < 6; y++) {
        const r = document.createElement('tr')
        t.appendChild(r)
        const re = []
        elem.push(re)
        for (let x = 0; x < word.length; x++) {
            const c = document.createElement('td')
            c.classList.add('empty', 'cell')
            if (word.length === 4) {
                c.classList.add('four-word')
            }
            if (word.length === 5) {
                c.classList.add('five-word')
            }
            if (word.length === 6) {
                c.classList.add('six-word')
            }
            r.appendChild(c)
            re.push(c)
        }
    }
    return elem
}

let attempt = 0
const tryWord = (w) => {
    for (let i = 0; i < word.length; i++) {
        let style = 'miss'
        if(w[i] == word[i]) style = 'correct'
        else if (word.indexOf(w[i]) >= 0) style = 'exists'
        const e = elem[attempt][i]
        e.classList.add(style)
        e.classList.remove('empty')
    }
    attempt++
    if(w == word) return 'Құттықтаймыз'
    else if (attempt >= 6) return 'Тағы да қайталап көрініз'
}

const gameOver = (msg, word) => {
    const gameOverModal = document.getElementById('gameOverModal')
    const gameOverMessage = document.getElementById('gameOverMessage')
    const wword = document.getElementById('wword')
    const starsContainer = document.getElementById('stars')

    let goldStars = 0
    if (attempt <= 2) {
        goldStars = 3
    } else if (attempt <= 4) {
        goldStars = 2
    } else if (attempt <= 6) {
        goldStars = 1
    }

    let stars = ''
        for (let i = 0; i < 3; i++) {
            stars += `<span class="star ${i < goldStars ? '' : 'gray-star'}"> ★ </span>`
        }

    gameOverMessage.textContent = msg
    wword.textContent = word
    starsContainer.innerHTML = stars
    gameOverModal.style.display = 'block'
}

const restartGame = () => {
    window.location.reload()
}

const elem = Table()
console.log('құпия сөз:', word)

let current = ''
let currentRow = 0
const soz = document.getElementById('soz')
const havent = document.getElementById('havent')
const del = document.getElementById('del')

document.addEventListener('keydown', (e) => {
    const c = e.key
    const l = current.length
    havent.style.display = 'none'
    
    del.addEventListener('click', () => {
        if (l > 0) {
        // Удаляем последний символ из текущей строки
        current = current.slice(0, -1);

        // Удаляем последний символ из таблицы
        const l = current.length;
        elem[attempt][l].innerText = '';
    }
    });

    if(c === 'Enter'){
        if(l === word.length){
            if(words.includes(current)){
                const res = tryWord(current)
                if(res) gameOver(`${res}!`,`${word}`)
                current = ''
            }else{
                havent.style.display = 'block'
                havent.classList.add('show');
                soz.innerText = 'Сөздікте бұндай сөз табылмады'
            }
        }else{
            havent.style.display = 'block'
            havent.classList.add('show');
            soz.innerText = 'Сөзде әріптер жетіспейді'
        }
    } else if(c === 'Backspace' && l > 0){
        current = current.substr(0, l-1)
        elem[attempt][l-1].innerText = ''
    } else if(/^[а-яА-ЯёЁa-zA-ZӘәҒғҚқҢңӨөҰұҮүҺһІі]$/.test(c) && l < word.length){
        current = current + c.toUpperCase()
        elem[attempt][l].innerText = c.toUpperCase()
    }
})

document.getElementById('define').addEventListener('click', () => {
    window.location.href = `https://www.google.com/search?q=define%3A+${word}`
})

// ойын шарты
const RuleBtn = document.querySelectorAll("#rulbtn");
  
RuleBtn.forEach(windowButton => {
    windowButton.addEventListener("click", () => {
        document.getElementById("rule").classList.add("open")
    })
})
const closeBtn = document.querySelectorAll("#close")
closeBtn.forEach(windowButton => {
    windowButton.addEventListener("click", () => {
        document.getElementById("rule").classList.remove("open");
    });
});

//keyboard
let currentWord = '';
let currentCol = 0;

document.getElementById('keyboard-icon').addEventListener('click', () => {
    const cells = document.querySelectorAll('.cell');
    const keyboard = document.getElementById('virtual-keyboard');

    cells.forEach(cell => {
        cell.classList.toggle('small');
    });

    keyboard.classList.toggle('show');
});

document.querySelectorAll('#virtual-keyboard button').forEach(button => {
    button.addEventListener('click', (e) => {
        const key = e.target.dataset.key;
        if (currentCol < 5 && currentRow < 6) { // Проверка, чтобы не выйти за пределы таблицы
            const cell = document.querySelectorAll('.row')[currentRow].children[currentCol];
            cell.innerText = key;
            currentWord += key;
            currentCol++;
        }
        if (currentCol === 5) {
            currentRow++;
            currentCol = 0;
            currentWord = '';
        }
    });
});
